import React from "react";
import { Link } from "react-router-dom";
import pokemonImg from '../../imagenes/pokemonTitle.png'
import styles from "./LandingPage.module.css";

export default function LandingPage(){
    return(
        <div className={styles.bg}>
            <div> 
            <img src={pokemonImg} alt="img not found" className={styles.image}></img>
            <h2 className={styles.autgir}>by Jonas David</h2>
           </div>
            <Link to='/home'>
                <button className={styles.buttonIng}>Let's go!</button>
            </Link>
        </div>
    )
}
